import React from "react";
import { Button, Typography } from "@mui/material";
import { Link } from "react-router-dom";

export default function LinkButton({ to, label, style }) {
  return (
    <>
      {type === "navbar" ? (
        <Button sx={{ mx: 2 }} color="inherit">
          <Link
            to={to}
            style={{
              textDecoration: "none",
              color: "white",
              fontSize: 22,
              ...style,
            }}
          >
            {label}
          </Link>
        </Button>
      ) : (
        <Typography sx={{ fontSize: { xs: 20, sm: 25 } }}>
          <Link
            to={to}
            style={{ textDecoration: "underline", color: "#2074d4" }}
          >
            {label}
          </Link>
        </Typography>
      )}
    </>
  );
}
